import React from 'react';
import ReactDOM from 'react-dom';
import { BroswerRouter } from 'react-router';

import App from "./components/App";


ReactDOM.render(
    <BroswerRouter>
        <App />
    </BroswerRouter>,
    document.getElementById('root'));
